let makeRelic = (type, scale = 1, label = '') => {
    let relicCasing = {
        PARENT: [exports.genericEntity],
        LABEL: 'Relic Casing',
        COLOR: type.COLOR,
        SHAPE: [[-0.4,-1],[0.4,-0.25],[0.4,0.25],[-0.4,1]].map(r => r.map(s => s * scale)),
    }
    let relicBody = {
        PARENT: [exports.genericEntity],
        LABEL: 'Relic Mantle',
        COLOR: type.COLOR,
        SHAPE: type.SHAPE,
    }
    exports[Math.random().toString(36).slice(2)] = relicCasing
    exports[Math.random().toString(36).slice(2)] = relicBody
    return {
        PARENT: [type],
        LABEL: label+'Relic',
        COLOR: 18,
        CONTROLLERS: [],
        VALUE: type.VALUE * 1e5,
        GUNS: Array(type.SHAPE * 2).fill().map((_, i) => ({
            POSITION: [
                4,
                6 * scale, 
                2.5,
                12, 
                i % 2 === 0 ? 8.25 + ((scale % 1) * 5) : -8.25 - ((scale % 1) * 5),
                Math.floor(i * 0.5) * (360 / type.SHAPE) + (type.SHAPE % 2 === 0 ? 0 : (180 / type.SHAPE)),
                0
            ]
        })),
        TURRETS: [{
            POSITION: [32.5, 0, 0, 0, 0, 0],
            TYPE: relicBody,
        }, ...Array(type.SHAPE * 2).fill().map((_, i) => ({
            POSITION: [
                8,
                -15,
                i % 2 === 0 ? 8.25 + ((scale % 1) * 5) : -8.25 - ((scale % 1) * 5),
                Math.floor(i * 0.5) * (360 / type.SHAPE),
                0,
                1
            ],
            TYPE: relicCasing,
        }))],
    }
}
