let GenerateCosShape = (width,length) => {
  let cosshape = 'M -'+width/2+' '+Math.cos((width/2)*length)+' '
  for (let i = -(width/2); i < width/2; i+=0.01) {
    cosshape = cosshape+'L '+i+' '+Math.cos(i*length)+' '
  }
  return cosshape
}
let GenerateSinShape = (width,length) => {
  let sinshape = 'M -'+width/2+' '+Math.sin((width/2)*length)+' '
  for (let i = -(width/2); i < width/2; i+=0.01) {
    sinshape = sinshape+'L '+i+' '+Math.sin(i*length)+' '
  }
  return sinshape
}
