let makeAtmosphere = (type,color,shape,asize,acolor,aalpha,astats) => {
  let newtank = JSON.parse(JSON.stringify(type));
  let newTurrets = [{POSITION: [15,0,0,0,360,1],
                  TYPE: [exports.auraA, {COLOR:color,SHAPE:shape}]}];
  if (type.TURRETS) {
    newtank.TURRETS = [...type.TURRETS, ...newTurrets];
  } else {
    newtank.TURRETS = newTurrets
  }
  if (type.GUNS != null) { newtank.GUNS = type.GUNS; }
  newtank.ATMOSPHERE = [asize,acolor,aalpha,astats]
  newtank.LABEL = type.LABEL+"-Atmosphere"
  return newtank
}
let AddTurrets = (type,turrets) => {
  let newtank = JSON.parse(JSON.stringify(type));
  if (type.TURRETS) {
    newtank.TURRETS = [...type.TURRETS, ...turrets];
  } else {
    newtank.TURRETS = turrets
  }
  if (type.GUNS != null) { newtank.GUNS = type.GUNS; }
  return newtank
}
